import React from 'react';
import Timer from './Timer.js';
import ScrollToTop from './utils/ScrollToTop.js';

class Home extends React.Component {

    render() {
        const myFunction = () => {
            const body = document.body; // For Safari
            const html = document.documentElement; // Chrome, Firefox, IE and Opera places the overflow at the html level, unless else is specified. Therefore, we use the documentElement property for these browsers
            body.scrollLeft = 0;
            body.scrollTop = 0;
            html.scrollLeft = 0;
            html.scrollTop = 0;
            console.log(`home topped out..`)
        }
        myFunction();
        return (
            <div className="App fadeIn">
                <header className="App-content">
                    <a className="App-link bold greet p-20 r-10 w-200 bg-green brdr-green"
                    href="https://jsongithub.github.io/portfolio/"
                    target="_self"
                    rel="noopener noreferrer"
                    >
                        portfolio
                    </a>
                    {/*<Lister items={[1,2,3]} />*/}
                    <Timer/>
                </header>
            </div>
        );
    };
}

export default Home;
